    [],nt"num_tags": 4,nt"name": "refuge-narrative-report-january-through-april-1962-kodiak-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Kodiak NWR outlines
    Refuge accomplishments from January through April of 1962. The report begins by
    summarizing the weather conditions, habitat conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, rodents, mammals, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments and
    wildfires. Resource management is outlined; topics include fur harvesting. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, Refuge
    participation, hunting, and violations. Items of interest, N-R forms, photographs,
    and a report on Karluk Lake bear studies are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
